#include <iostream>
#include <windows.h>
#include <vector>
#include <algorithm>

using namespace std;

void sorting(vector<double>& double_v_array) {
    sort(double_v_array.begin(), double_v_array.end());
}
void sorting(vector<int>& int_v_array) {
    sort(int_v_array.begin(), int_v_array.end());
}
int main()
{
    SetConsoleOutputCP(1251);
    SetConsoleCP(1251);
    vector <double> double_v_array{};
    vector <int> int_v_array{};
    int N{}, type{}, length{}, int_element{};
    double double_element{};
    while (true) {
        cout << "–í–≤–µ–¥—ñ—Ç—å –ù–û–ú–ï–† –º–∞—Å–∏–≤—É, —è–∫–∏–π –±–∞–∂–∞—î—Ç–µ –≤—ñ–¥—Å–æ—Ä—Ç—É–≤–∞—Ç–∏ " << endl << "1 - –¶—ñ–ª–æ—á–∏—Å–µ–ª—å–Ω–∏–π" << endl << "2 - –ó –ø–ª–∞–≤–∞—é—á–æ—é –∫–æ–º–æ—é" << endl;
        cin >> type;
        if (cin.fail() || cin.peek() != '\n' || (type != 1 && type != 2)) {
            cin.clear();
            cin.ignore(32767, '\n');
            cout << "–ù–æ–º–µ—Ä –º–∞—Å–∏–≤—É –±—É–ª–æ –≤–≤–µ–¥–µ–Ω–æ –Ω–µ–ø—Ä–∞–≤–∏–ª—å–Ω–æ. –°–ø—Ä–æ–±—É–π—Ç–µ —â–µ —Ä–∞–∑!" << endl;
            continue;
        }
        else {
            break;
        }
    }
    string words_array[10]{ "–ø–µ—Ä—à–∏–π", "–¥—Ä—É–≥–∏–π", "—Ç—Ä–µ—Ç—ñ–π", "—á–µ—Ç–≤–µ—Ä—Ç–∏–π", "–ø'—è—Ç–∏–π", "—à–æ—Å—Ç–∏–π", "—Å—å–æ–º–∏–π", "–≤–æ—Å—å–º–∏–π", "–¥–µ–≤'—è—Ç–∏–π", "–¥–µ—Å—è—Ç–∏–π" };
    while (true) {
        cout << "–í–≤–µ–¥—ñ—Ç—å –±–∞–∂–∞–Ω—É –∫—ñ–ª—å–∫—ñ—Å—Ç—å –µ–ª–µ–º–µ–Ω—Ç—ñ–≤ —É –º–∞—Å–∏–≤—ñ (–≤—ñ–¥ 2 –¥–æ 10): ";
        cin >> N;
        if (cin.fail() || cin.peek() != '\n' || N < 2 || N > 10) {
            cin.clear();
            cin.ignore(32767, '\n');
            cout << "–ß–∏—Å–ª–æ –±—É–ª–æ –≤–≤–µ–¥–µ–Ω–æ –Ω–µ–ø—Ä–∞–≤–∏–ª—å–Ω–æ. –°–ø—Ä–æ–±—É–π—Ç–µ —â–µ —Ä–∞–∑!" << endl;
            continue;
        }
        else {
            break;
        }
    }
    for (int i = 0; i < N; i++) {
        while (true) {
            cout << "–í–≤–µ–¥—ñ—Ç—å " << words_array[i] << " –µ–ª–µ–º–µ–Ω—Ç –º–∞—Å–∏–≤—É: ";
            if (type == 1) {
                cin >> int_element;
                int_v_array.push_back(int_element);
            }
            else if (type == 2) {
                cin >> double_element;
                double_v_array.push_back(double_element);
            }
            if (cin.fail()) {
                cin.clear();
                cin.ignore(32767, '\n');
                cout << "–ß–∏—Å–ª–æ –±—É–ª–æ –≤–≤–µ–¥–µ–Ω–æ –Ω–µ–ø—Ä–∞–≤–∏–ª—å–Ω–æ. –°–ø—Ä–æ–±—É–π—Ç–µ —â–µ —Ä–∞–∑!" << endl;
                continue;
            }
            else {
                break;
            }
        }
    }
    if (type == 1) {
        sorting(int_v_array);
        cout << "–í—ñ–¥—Å–æ—Ä—Ç–æ–≤–∞–Ω–∏–π –º–∞—Å–∏–≤: ";
        length = size(int_v_array);
        for (int i = 0; i < length; i++) {
            cout << int_v_array[i] << " ";
        }
    }
    else if (type == 2) {
        sorting(double_v_array);
        cout << "–í—ñ–¥—Å–æ—Ä—Ç–æ–≤–∞–Ω–∏–π –º–∞—Å–∏–≤: ";
        length = size(double_v_array);
        for (int i = 0; i < length; i++) {
            cout << double_v_array[i] << " ";
        }
    }
}

#include <iostream>
#include <windows.h>
#define _USE_MATH_DEFINES
#include <math.h>

using namespace std;

double calculate_area(double length, double width) {
    return length * width;
}
double calculate_area(double radius) {
    return M_PI * radius * radius;
}
int main()
{
    SetConsoleOutputCP(1251);
    SetConsoleCP(1251);
    double a{}, b{}, r{};
    while (true) {
        cout << "–í–≤–µ–¥—ñ—Ç—å –¥–æ–≤–∂–∏–Ω—É –ø—Ä—è–º–æ–∫—É—Ç–Ω–∏–∫–∞: ";
        cin >> a;
        if (cin.fail() || a <= 0) {
            cin.clear();
            cin.ignore(32767, '\n');
            cout << "–î–æ–≤–∂–∏–Ω—É –ø—Ä—è–º–æ–∫—É—Ç–Ω–∏–∫–∞ –±—É–ª–æ –≤–≤–µ–¥–µ–Ω–æ –Ω–µ–ø—Ä–∞–≤–∏–ª—å–Ω–æ. –°–ø—Ä–æ–±—É–π—Ç–µ —â–µ —Ä–∞–∑!" << endl;
            continue;
        }
        else {
            break;
        }
    }
    while (true) {
        cout << "–í–≤–µ–¥—ñ—Ç—å —à–∏—Ä–∏–Ω—É –ø—Ä—è–º–æ–∫—É—Ç–Ω–∏–∫–∞: ";
        cin >> b;
        if (cin.fail() || b <= 0) {
            cin.clear();
            cin.ignore(32767, '\n');
            cout << "–®–∏—Ä–∏–Ω—É –ø—Ä—è–º–æ–∫—É—Ç–Ω–∏–∫–∞ –±—É–ª–æ –≤–≤–µ–¥–µ–Ω–æ –Ω–µ–ø—Ä–∞–≤–∏–ª—å–Ω–æ. –°–ø—Ä–æ–±—É–π—Ç–µ —â–µ —Ä–∞–∑!" << endl;
            continue;
        }
        else {
            break;
        }
    }
    while (true) {
        cout << "–í–≤–µ–¥—ñ—Ç—å —Ä–∞–¥—ñ—É—Å –∫–æ–ª–∞: ";
        cin >> r;
        if (cin.fail() || r <= 0) {
            cin.clear();
            cin.ignore(32767, '\n');
            cout << "–†–∞–¥—ñ—É—Å –∫–æ–ª–∞ –±—É–ª–æ –≤–≤–µ–¥–µ–Ω–æ –Ω–µ–ø—Ä–∞–≤–∏–ª—å–Ω–æ. –°–ø—Ä–æ–±—É–π—Ç–µ —â–µ —Ä–∞–∑!" << endl;
            continue;
        }
        else {
            break;
        }
    }
    cout << "–ü–ª–æ—â–∞ –ø—Ä—è–º–æ–∫—É—Ç–Ω–∏–∫–∞: " << calculate_area(a, b) << endl;
    cout << "–ü–ª–æ—â–∞ –∫—Ä—É–≥–∞: " << calculate_area(r) << endl;
}
